    to pay these expenses with 100% federal funds. No employee of the Committee spent
    more than 25% of compensated time during any month within the reporting period
    engaged in Federal Election Activity. Payments for salaries and related fringe
    benefits disclosed on Schedule H4 are for employees who spent less than 25% of
    their time engaged in activities in connection to any federal election."
